import { expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
test('plugins', async () => {
    const r1 = await request('http://mp1.w2.org/index.html');
    expect(r1.res.headers['content-type']).toBe('text/html; charset=gbk');
    expect(r1.data.headers['x-whistle-rule-value']).toBe('123');
    const r2 = await request('https://ths.w2.org/index.html');
    expect(r2.data.test).toBe('values');
});
